 Izna, a porn star is hired by an intelligence
 officer Aayan Thakur and Security Chief Guru 
 Saldanah  to become a 'Honey-trap' and help  
 them retrieve critical information from a    
 dreaded assassin Kabir. During this mission  
 Aayan gets to know about Izna's previous     
 relationships with Kabir when Kabir,         
 himself used to work for the intelligence.   
 Kabir was discovered by Izna during one      
 of his missions where Izna was being used for
 drug-peddling in a pub, which she was unaware
 of. Kabir makes an entry in the pub,         
 shoots and arrests the guilty drug-peddlers. 





